import React from "react";
import "./RecipeInfo.css";

export default function RecipeInfo() {
  return (
    <div className="recipe-info">
      <h1 id="recipe-name"></h1>
      <p id="recipe-synopsis"></p>
      <button id="goToRecipe">Go to recipe!</button>
    </div>
  );
}
